\N	\N	محطات متعددة	خصص شاشة منفصلة لكل محطة إعداد مع تحديد الحالة النهائية للطلبات بسهولة، ما يضمن سير العمل بمرونة وكفاءة.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "خيارات دفع إلكتروني متنوعة", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "اجعل عملية الدفع سريعة وآمنة مع خيارات متعددة، مما يقلل من طوابير الانتظار ويزيد من كفاءة العمليات.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	8131	ar	be4fd4c2-94e8-487e-ba13-4bda0b639657
\N	\N	استقبل و جهز الطلبات بدقة	أدخل و نظم الطلبات بسرعة جنبًا إلى جنب مع طلبات الفروع الأخرى وتطبيقات التوصيل، مع حساب أوقات التحضير والتوصيل من واجهة واحدة.	\N	\N	\N	8132	ar	153682b0-5b37-4b00-90fa-3551918b37f9
