\N	\N	إدارة الموردين والمشتريات	أنشئ وأدر عمليات الشراء بسهولة، واقبل أو ارفض الطلبات بضغطة زر، مع تتبع الموردين بفعالية.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "إعدادات تخصيص متقدمة", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "خصص المنتجات والأسعار والطاولات حسب الفرع، واحصل على تجربة فريدة تلائم رابطتك التجارية.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	SECTION	\N	14698	ar	195b168b-6649-4fc0-952c-d75c1de1f621
