\N	\N	إدارة ذكية للطلبات	حدد مصدر وحالة الطلبات واعرض تفاصيلها بسهولة، بالإضافة إلى إمكانية تصنيفها بالألوان لتفادي الارتباك.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "خيارات شاملة لتخصيص الطلبات", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "مساعدة العملاء على تخصيص اختياراتهم بسهولة عبر قائمة منتجات محدثة وسلة طلب مرنة تزيد من رضاهم.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	18648	ar	dc487794-41ab-4935-8a21-88d9a1066f3f
