\N	\N	استقبل و جهز الطلبات بدقة	ادخل و نظم الطلبات بسرعة جنبًا إلى جنب مع طلبات الفروع الأخرى وتطبيقات التوصيل، مع حساب أوقات التحضير والتوصيل من واجهة واحدة.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "قوائم مخصصة حسب الفرع", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "أنشئ قوائم مخصصة لكل فرع بسهولة، مع ضمان إدارة موحدة تسهل تحديث المنتجات ومزامنة التغييرات في الوقت الفعلي.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	SECTION	\N	10828	ar	022080b1-1b4e-4324-a067-e5ca5a379e39
\N	\N	نظّم منتجاتك وراقب المخزون من أي مكان	نظم وخصص المنتجات بدقة وتلقى إشعارات لتجنب التخزين الزائد أو نفاد العناصر، مع خيار تصدير أو طباعة البيانات.	\N	\N	\N	10829	ar	e48999e0-ed1b-46e7-8f69-f740d9f43894
\N	\N	طرق دفع متنوعة وآمنة وسهلة لعملائك	استقبل المدفوعات من خلال طرق متنوعة مثل النقد، بطاقات الائتمان، أبل باي، بطاقات الهدايا، والمزيد، وفقًا لتفضيلات العملاء، بشكل آمن.	\N	\N	\N	10830	ar	691fcac5-4c66-4cfa-b573-f29b6f7c3ebd
48faf459-4aec-4c9e-9d51-5bf93490866b	\N	تحضير الطلبات في وقت قياسي	تحكم تام في الطلبات وسرع من وقت الإعداد مما يزيد من رضا الزبائن ويدفع بعجلة المبيعات.	\N	\N	\N	7522	ar	c3261db3-447a-4e26-adc6-9bd2cf821b95
b408d5e6-f579-484d-8ad9-d335239f1c6f	\N	خفض الأخطاء وزيادة الكفاءة	مع عرض جميع الطلبات في واجهة واحدة، تتقلص فرص الخطأ، مما يؤدي إلى عمليات يومية أسهل وأكثر نجاحًا.	\N	\N	\N	7523	ar	3ac8163f-f5bc-4d93-a584-e0ebcaa742cf
