\N	\N	تكامل شامل	اعتمد على الربط المتكامل مع الشركاء والكاشير لتوحيد قنوات البيع على شاشة واحدة، مما يسهل تنظيم جميع الطلبات دون عناء.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "شاشة عرض لإعلاناتك", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "قدّم لعملائك تجربة فريدة مع عرض وتخصيص الوسائط على شاشة التفاعل لجذب الانتباه وتعزيز التجربة.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	7526	ar	4178b901-1cd9-4493-89c1-4fc00adaf836
\N	\N	إدارة ذكية للطلبات	حدد مصدر وحالة الطلبات واعرض تفاصيلها بسهولة، بالإضافة إلى إمكانية تصنيفها بالألوان لتفادي الارتباك.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "خيارات شاملة لتخصيص الطلبات", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "مساعدة العملاء على تخصيص اختياراتهم بسهولة عبر قائمة منتجات محدثة وسلة طلب مرنة تزيد من رضاهم.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	7527	ar	34900b3b-dd03-46dc-9b60-2b0151994523
\N	\N	تحضير فعال وسريع	تابع مدة تحضير الطلب فور وصوله لمطبخك وتمتع بالتحكم الكامل في إكمال تحضير كل منتج بشكل فردي وفقًا للاحتياجات.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "تحديد نوع الطلب المفضل", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "سواء كان الطلب سفريًا أو داخلياً في المطعم، يمكن للعملاء تحديد ذلك بكل سهولة مما يعزز التنظيم والكفاءة.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	7528	ar	012c97d1-8bd4-4850-b618-1864a0dc98e2
\N	\N	محطات متعددة	خصص شاشة منفصلة لكل محطة إعداد مع تحديد الحالة النهائية للطلبات بسهولة، ما يضمن سير العمل بمرونة وكفاءة.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "خيارات دفع إلكتروني متنوعة", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "اجعل عملية الدفع سريعة وآمنة مع خيارات متعددة، مما يقلل من طوابير الانتظار ويزيد من كفاءة العمليات.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	7529	ar	d2c65308-3862-448c-a40e-ba349a3ea9cf
