\N	\N	بناء وإدارة الوصفات بسهولة	يمكنك إنشاء الوصفات تلقائيًا أو إعدادها مسبقًا مع إنتاج كميات منها بكل سهولة لتوفر الوقت والمجهود.\n	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "استيراد وتصدير البيانات بسهولة", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "ضغطة زر، يمكنك استيراد أو تصدير القوائم والمنتجات والإضافات عبر ملفات Excel. هذا يسهّل تحديث القوائم ويمنحك المرونة في إدارة المخزون.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	10933	ar	fa8eafcc-cdc0-4563-828b-a98df06a09e2
\N	\N	تتبع حركة المخزون بالتفصيل	راقب كل حركة للمخزون بتقارير دقيقة وسجل كامل لجميع العمليات من استلام وتخزين وتحويل واسترجاع.	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "تخصيص الأصناف والإضافات", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "اضف لمسة خاصة إلى منيو مطعمك من خلال إضافة وتصنيفات متعددة لكل منتج. كما يمكنك تعديل الإضافات بكل سهولة لتلبية احتياجات عملائك.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	10934	ar	6fdac830-c8d0-4b44-b2a7-6f78307022e7
