\N	\N	بناء وإدارة الوصفات بسهولة	يمكنك إنشاء الوصفات تلقائيًا أو إعدادها مسبقًا مع إنتاج كميات منها بكل سهولة لتوفر الوقت والمجهود.\n	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h2", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "مؤشرات حية، قرارات أسرع", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "راقب أداء عملك لحظة بلحظة من خلال مؤشرات رئيسية محدّثة في الوقت الفعلي لتبقى دائمًا على اطلاع بكل التفاصيل المهمة.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	جديد	\N	13067	ar	fc1a3e77-951b-4090-913b-8b9e473278cb
