كيف أتابع كميات المخزون؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "يمكنك متابعة المخزون من قسم \\"المخزون\\" في لوحة التحكم. يعرض النظام الكميات الحالية لكل منتج، وينبهك عند انخفاض الكمية عن الحد الأدنى المحدد مسبقاً.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	2	ar	7fecaec5-825e-4113-83b6-cfc51d6d5a3b
هل يمكنني إلغاء أو استرداد عملية بيع؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "نعم، يمكنك إلغاء أو استرداد عمليات البيع من خلال قائمة \\"المبيعات\\" في لوحة التحكم. ابحث عن المعاملة المطلوبة واختر \\"استرداد\\" أو \\"إلغاء\\" حسب حالة المعاملة.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	3	ar	03052b9f-0981-4d42-af1a-74dece556e1d
كيف أتعامل مع العروض والخصومات؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "يمكنك إعداد العروض والخصومات من قسم \\"العروض\\" في لوحة التحكم. يمكنك إنشاء خصومات بنسبة مئوية أو مبلغ ثابت، وتحديد فترة صلاحية العرض والمنتجات المشمولة.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	4	ar	ad9447d8-2f60-4015-9ae3-c646fc4563cf
هل يمكن استخدام النظام بدون إنترنت؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "نعم، النظام يعمل في وضع عدم الاتصال. يمكنك تسجيل المبيعات والعمليات محلياً، وسيقوم النظام بمزامنة البيانات تلقائياً عند عودة الاتصال بالإنترنت.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	5	ar	e2379785-a2ac-4c40-a42e-00006c49cb82
كيف أدير طلبات التوصيل والطلبات الحضورية؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "يمكنك إدارة جميع الطلبات من محطة الطلبات. يظهر النظام الطلبات الحضورية وطلبات التوصيل في شاشة موحدة، مع إمكانية تتبع حالة كل طلب وتحديث المراحل.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	6	ar	cf5ecab8-ad9f-4c1b-90a9-9f0fbd05aa31
كيف أضيف منتج جديد إلى النظام؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "لإضافة منتج جديد، اذهب إلى قسم \\"المنتجات\\" في لوحة التحكم، اضغط على \\"إضافة منتج جديد\\"، أدخل اسم المنتج، السعر، الباركود (اختياري)، والفئة، ثم احفظ التغييرات.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	7	ar	96583b6c-089c-4ab4-8822-feabeb1236c9
كيف أطلع على تقارير المبيعات؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "اذهب إلى قسم \\"التحليلات\\" في لوحة التحكم لمشاهدة تقارير مفصلة عن المبيعات، الأرباح، والمنتجات الأكثر مبيعاً. يمكنك تصفية التقارير حسب التاريخ، الفرع، أو فئة المنتج.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	9	ar	adf12a19-d94a-43e0-b315-2dc9058d81c8
