ماذا أفعل إذا واجهت مشكلة تقنية؟	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"text": "في حال واجهت أي مشكلة تقنية، يمكنك التواصل مع فريق الدعم الفني على مدار 24/7 من خلال الدردشة المباشرة في التطبيق، أو الاتصال على رقم الدعم، أو إرسال بريد إلكتروني.", "type": "text", "style": "", "format": ""}], "direction": "rtl"}], "direction": "rtl"}}	11	ar	22847c9a-2530-4026-88fe-ff5da941102b
