\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "واكب تغيرات المخزون", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "تتبع حركة المخزون بدقة في كل عملية بيع، بالإضافة إلى تلقي تنبيهات فورية وتقارير مبنية على بيانات حقيقية لضمان عدم نقصان أي منتج في متجرك أو مطعمك.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	43	ar	a83e15e7-1685-4bb5-93c1-e181fb8102d0
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "حوّل بياناتك إلى قرارات ذكية", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "اكتشف قوة التحليلات المتقدمة مع لوحات بيانات مخصصة، تقارير شاملة، ومؤشرات في الوقت الفعلي، لتبقى دائمًا متقدمًا بخطوة على منافسيك.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	48	ar	ea08daa8-c3a8-4d55-bd4b-935f0dfdebd1
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "شغل جميع فروعك من نظام واحد", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "توفر منظومة مرن تحكم كامل على جميع فروعك من مكان واحد، مما يوفر لك الوقت والجهد في متابعة الأداء واتخاذ القرارات الفعالة بسرعة.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	51	ar	da5eb888-d8e1-4ae3-80d0-70cd28bfd07b
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "نظام كاشير متكامل", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "يجعل معالجة الطلبات سهلاً وسريعاً داخل الفرع أو بين الفروع. يجمع بين السهولة والذكاء في إدارة مبيعاتك وتحليل البيانات بشكل فوري ومباشر.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	63	ar	e3acdb42-30c7-4583-bba9-4239815ee076
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "سهولة الدفع للعملاء", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "قم بعرض الصور والمقاطع الدعائية، ملخص الطلبات واستقبل المدفوعات بسلاسة من خلال شاشة العرض المواجهة للعميل.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	64	ar	b871c588-80a5-4688-b00a-27daefdf5142
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "استقبل الطلبات بدون تدخل بشري", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "اجعل عملائك يطلبون بأنفسهم بواجهة سهلة وسداد ذاتي سريع. قلل الطوابير وزد من حجم الطلبات مع اقتراحات ذكية لمنتجات إضافية.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	65	ar	c92ef5a8-044f-4678-b3e7-ae6db8ff6eeb
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "تابع الطلبات من جميع المصادر", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "مع محطة الطلبات من مرن، اجمع كل قنوات البيع على شاشة واحدة لتسهيل إدارة الطلبات وتقليل الأخطاء مهما زاد الضغط. تتيح لك هذه الميزة الربط مع الشركاء والكاشير لتحضير أسرع وبدون تعقيدات.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	66	ar	163195fe-c9ec-4e90-b3a7-33c8a2c149a5
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "إدارة المنتجات والقوائم", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "سهّل على نفسك إدارة منتجات محلك أو قائمة مطعمك مباشرة من نظام مَرِن. عدّل الأسعار، والأصناف، والإضافات بكل سهولة لتلبية رغبات عملاءك.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	67	ar	d0dfa153-e137-434f-9bbe-c6801387eb41
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "تبسيط المحاسبة وحساب الضريبة", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "تخلص من تعقيد المحاسبة والضرائب. احصل على حسابات دقيقة ومتوافقة مع هيئة الزكاة والضريبة السعودية بسهولة وسرعة لتبقى دوماً على الطريق الصحيح.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	68	ar	166f1574-4589-443b-a0d6-ee7503dbf744
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "منظومتك المرنة", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "نظام كاشير حديث يرتب عملك بسهولة وبسعر يناسبك—مصمم للمطاعم ومحلات التجزئة في السعودية", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	ae793ce3-2e75-4796-a3a9-a10ede74a556	\N	\N	\N	\N	\N	6e07b5e3-2e5a-4597-bede-7d1c054564d0	\N	75	ar	052105a8-7027-4125-bfd9-d8ab28c3aa7c
\N	{"root": {"type": "root", "format": "", "indent": 0, "version": 1, "children": [{"tag": "h1", "type": "heading", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "خلي العملاء في قلب أعمالك", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl"}, {"type": "paragraph", "format": "", "indent": 0, "version": 1, "children": [{"mode": "normal", "text": "زد من كفاءة استراتيجياتك التسويقية عبر تقارير شاملة عن عملائك وتفضيلاتهم. احصل على بيانات دقيقة وسجل طلبات مفصل لكل عميل لتحسين تفاعلك ومبيعاتك.", "type": "text", "style": "", "detail": 0, "format": 0, "version": 1}], "direction": "rtl", "textStyle": "", "textFormat": 0}], "direction": "rtl"}}	\N	\N	\N	\N	\N	\N	\N	\N	71	ar	98a0847c-b203-46c3-b85e-3e0b591c8082
